import React from "react";

const headerComponent:React.FC = () => {
  return (
    <header id="headerBar">
      <div className="content">
        <img src="../assets/images/logo.png" alt="" />
        <h1>Klinik Medika</h1>
      </div>
    </header>
  )
}

export default headerComponent;
